import React from "react";
import "./Login.css";
import logo from "../../logo.svg";
import Form from "../../components/Form/Form";

const Login = () => {
  return (
    <div className="Login">
      <img src={logo} className="App-logo" alt="logo" />
      <Form />
    </div>
  );
};

export default Login;
